from django.db import modelsfrom apps.account.models import PatientModel, Accountfrom apps.logus.models import ServiceModelSTATUS_CHOICES = (    ("", ""))class ScheduleModel(models.Model):    patient = models.ForeignKey(PatientModel, on_delete=models.CASCADE)    service = models.ForeignKey(ServiceModel, on_delete=models.CASCADE)    start_time = models.DateTimeField()    end_time = models.DateTimeField()    status = models.CharField(choices=STATUS_CHOICES)    created_by = models.ForeignKey(Account, on_delete=models.SET_NULL, null=True, related_name="schedules")    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_schedule_by_user", on_delete=models.SET_NULL, null=True)    def __str__(self):        return self.status